(6276, 173, 744, 1, 'something is coming', '第二十四屆金旋獎 假勇樂團入圍樂團創作組決賽的曲目就是這首', '2008-04-01 00:00:00', 0000, 0, 1, 7, 'Then, I woke to find myself in the dark woods that night\r\nCan you feel it when I’m around just as the wind blows from that flowing river \r\n\r\nIf I wear a little, little smile\r\nWill you feel a little, little sad\r\n\r\nUnexpected I feel desperately relieved\r\nMidway the path I whispering\r\nWith heaviest heart I heading\r\nFading\r\n\r\n', '', 312, '', '假勇樂團', '嘿唷嘎', '假勇樂團', '', '', 0, 0, 1, '2008-06-28 14:35:56', '2013-10-07 17:12:40', '0000-00-00 00:00:00'),
(6277, 173, 744, 2, 'you are nobody', '', '2008-04-01 00:00:00', 0000, 0, 1, 7, 'Sometimes you feel so depressed\r\nFeel like there’s nothing right\r\nBefore you fall asleep at night\r\nYou wonder why\r\nYears passed you are not that young anymore\r\nYou tried your very best still nobody knows\r\n\r\nYou know you are not that special after all\r\nMaybe you can stop living in fantasies because you’re gonna fail\r\n\r\nLa ～', '', 202, '', '假勇樂團', '嘿唷嘎', '假勇樂團', '', '', 0, 0, 1, '2008-06-28 14:39:05', '2013-10-07 17:12:40', '0000-00-00 00:00:00'),
(6278, 173, 744, 3, 'the story begins', '第二十五屆金旋獎決賽中場播放影片中 訪問第二十四屆樂團創作組假勇樂團 開頭唱的就是這首歌', '2008-04-01 00:00:00', 0000, 0, 1, 7, 'I bet you’ve never felt that everything’s so great in this way\r\nUntil the very moment you start to realize why is it\r\n\r\nWhen walk along that quiet street at summer nights\r\nThe air is fresh, the wind is mild, everything seems so fine\r\nWith a hope the story will never end, it’s a lifelong one\r\nBecause, you know, the story begins\r\n\r\n', '', 177, '', '假勇樂團', '嘿唷嘎', '假勇樂團', '', '', 0, 0, 1, '2008-06-28 14:41:51', '2013-10-07 17:12:40', '0000-00-00 00:00:00'),
