(6280, 2772, 0, 3, '回憶 （吉他演奏）', '寫下這首歌時，心裡是有明顯畫面的；\r\n\r\n夜深人靜，總是容易勾起人們回憶的漣漪，會不會又酸又甜，又會帶有些惆悵呢？\r\n', '2009-06-01 00:00:00', 0000, 0, 2, 5, '', '', 166, '', '小時', '', '小時', '', '', 0, 0, 0, '2008-06-30 00:31:59', '2015-03-12 13:33:26', '0000-00-00 00:00:00'),
(6281, 2772, 748, 2, '失樂園', '就像詞裡寫的一樣，音樂的感覺就是有點龐克，放克當基調，有點迷情，有點混亂，想宣洩出暗黑迷惘的一面 ~\r\n\r\n這樣的感覺，是低潮期嗎??\r\n', '2009-06-01 00:00:00', 0000, 0, 2, 1, '生活不如意 總覺得天天不順心\r\n一手啤酒淋上我的心\r\n我只想昏迷\r\n\r\n你一直在我面前晃來晃去\r\n遊魂般的你總像支冰\r\n突然扭腰擺臀把我哈醒\r\n一步一步掉到失樂園裡\r\n\r\n甚麼感覺最讓人不可抗拒\r\n只有自己知道自己最滿意\r\n薄弱的抑制是人最可悲的東西\r\nSo come on baby\r\nI''ll let you happy\r\n\r\n吶........\r\n\r\n愛情編織後的結局\r\n早就搞不清是真心還是你的假裝虛偽\r\n黑夜白天兩個不同世界\r\n消失的界線讓我們彼此相互沉醉\r\n\r\n混亂的世界\r\n去考驗迷惘的關係\r\n不要緊  別擔心  就讓我和你\r\n', '', 296, '', '小時', '小時', '小時', '', '', 0, 0, 0, '2008-06-30 01:04:58', '2015-03-12 13:33:26', '0000-00-00 00:00:00'),
(6282, 2782, 0, 1, '紐式魔法', '', '0000-00-00 00:00:00', 0000, 15, 0, 4, '紐式魔法\r\n有你陪我  oh~對不起 我感到好寂寞\r\n就讓我帶你  讓你看看我們的  紐式魔法\r\n\r\n咻比嘟比  咻比嘟比  \r\n眼神專注一點點來\r\n\r\n咻比嘟比  咻比嘟比 \r\n咻比嘟比  一起唸  來 \r\n\r\n不要害羞 不要害羞\r\n聲音再多 一點點來 \r\n\r\n咻比嘟比  集中呼吸\r\n迎接一個新的自己\r\n\r\nlala~lalala 意外的美麗\r\n紐式魔法  隱藏了很多很多秘密\r\nlala~~lalala 全世界在一起\r\n想去哪裡  都只有這樣的咒語\r\n\r\n\r\n一樣聲音  Oh~每個人都有不同感覺\r\n直覺反應  Funk帶你進入  我們的紐式魔法\r\n\r\n\r\n咻比嘟比  咻比嘟比  \r\n眼神專注  一點點來\r\n\r\n咻比嘟比  咻比嘟比 \r\n咻比嘟比  一起唸來 \r\n\r\n不要害羞 不要害羞\r\n聲音再多 一點點來\r\n\r\n咻比嘟比  集中呼吸\r\n迎接一個新的自己\r\n\r\nlala~~lalala 意外的美麗\r\n紐氏魔法 隱藏了很多很多秘密\r\nlala~~lalala  整個世界在一起\r\n想去哪裡  都只有這樣的咒語\r\n\r\n咻比嘟比*3\r\n迎接一個新的自己\r\n\r\nlala~~lalala 意外的美麗\r\n紐式魔法 隱藏了很多很多秘密\r\nlala~~lalala  整個世界在一起\r\n想去哪裡  都只有這樣的咒語\r\n\r\nlala~~lalala 意外的美麗\r\n紐式魔法 隱藏了很多很多秘密\r\nlala~~lalala  整個世界在一起\r\n想去哪裡  都只有這樣的咒語\r\n', '', 256, '', '阿joe', '阿joe、mei', '峰子、紐約客', '金革', '', 0, 0, 1, '2008-06-30 11:17:49', '2013-10-07 17:12:40', '0000-00-00 00:00:00'),
