(6401, 2211, 0, 1, 'Haru', '', '2011-08-09 00:00:00', 0000, 0, 1, 7, '天好像亮了  照亮的是什麼?\r\n笑著的眼神  總是差一點哭了\r\n\r\n你背上有著那  那些痕跡有\r\n期待的  有失落的\r\n而他呢  只有坐著哭著\r\n\r\n  haru  haru  .................\r\n├\r\n  所有時間溶化 重新再黏成一段時光\r\n  就能夠幸福吧\r\n\r\n你身上的線  帶著你\r\n走向他身邊  沒有自覺\r\n看不到眼前  雖然你\r\n明白這一切\r\n\r\n你好像睡了  而我永遠都醒著\r\n睜眼看著你  夢著不愛你的他\r\n\r\n*\r\n  haru  haru.....................\r\n├\r\n  我要許一個魔法  讓你停止不再思念他\r\n  或許這不可能吧\r\n\r\n如果有一天  你能夠\r\n如果有一天  能夠發覺\r\n如果有一天  他的世界\r\n離你很遙遠  沒有你的空間', '', 335, '', '', '', '', '', '', 1, 1, 0, '2008-07-01 03:59:26', '2015-03-12 13:33:30', '0000-00-00 00:00:00'),
